import React from 'react';
import Todo from './Todo';
import './css/todoList.css';

const todos =[
    {
        "description":"Einkauf",
        "done":true
    },
    {
        "description":"Programmieren",
        "done":false
    },
    {
        "description":"Sport",
        "done":false
    }
]


const TodoList = () => {
    return (
        <div>
            <h1>My Todos</h1>
            {
                todos.map((iterator,index) =>{
                    // params
                    return <Todo description={iterator.description} done={iterator.done} key={index}></Todo>
                })

            }
        </div>
  )
}

export default TodoList;
